body:
@yufenglee. My main concern is that for the _same_ ONNX model, Py and C# OnnxRuntime produce _different_ results.  This is inconsistent.  At the very minimum, I would expect OnnxRuntime to produce exact  outputs using OnnxRuntime Python and C# libraries.

Also, I do not think it's fair to say the model is weird.  

The [BERTModel ](https://huggingface.co/transformers/model_doc/bert.html#bertmodel) returns  output tensors.   Giving names to the output tensors / using a dictionary for metadata, etc are pure ONNX abstractions.  As an end user, the expectation is that ONNX should produce the same output tensors as PyTorch.
